create table sys_dict_data
(
    id             bigint       not null comment '主键ID'
        primary key,
    parent_id      bigint       null comment '父级字典id',
    dict_type_code varchar(60)  null comment '字典类型编码',
    label          varchar(30)  null comment '字典标签',
    value          varchar(30)  null comment '字典值',
    sort           int          null comment '排序',
    remark         varchar(200) null comment '备注',
    del_flag       char         null comment '逻辑删除标识',
    create_id      bigint       null comment '创建人id',
    create_time    datetime     null comment '创建时间',
    update_id      bigint       null comment '最后一次更新人id',
    update_time    datetime     null comment '最后一次更新时间',
    status         char         null comment '状态',
    tag_style      varchar(100) null comment '标签的样式'
)
    comment '字典数据表' row_format = DYNAMIC;

